"use strict";(self.webpackChunkWhaTap_Docs=self.webpackChunkWhaTap_Docs||[]).push([["78709"],{41979:function(e){e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"overview","metadata":{"permalink":"/en/blog/overview","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/overview.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/overview.mdx","title":"Service overview","description":"New Feature Overview","date":"2024-10-31T15:30:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"Service overview","permalink":"/en/blog/tags/service-overview"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"overview","title":"Service overview","authors":"ysj","date":"2024-10-31T15:30","toc_max_heading_level":2,"tags":["New features","Service overview"],"isTranslationMissing":false},"unlisted":false,"nextItem":{"title":"Third quarter guidance","permalink":"/en/blog/2024-3q-summary"}},"content":"import CustomListItem from \'@site/src/components/CustomListItem\';\\n\\nimport ChangelogComponent from \'@site/src/components/ChangelogComponent\';\\n\\n![New Feature Overview](/img/changelog/new_feature_overview_txt.png)\\n\\nTake a look at the overview of new features for the services provided by WhaTap at a glance.\\n\\n{/* \uC640\uD0ED\uC758 \uC11C\uBE44\uC2A4 \uD788\uC2A4\uD1A0\uB9AC \uAC1C\uC694\uB97C \uD55C \uB208\uC5D0 \uC0B4\uD3B4\uBCF4\uC138\uC694. */}\\n\\n{/* truncate */}\\n\\n<br/>\\n<br/>\\n\\n<div class=\'history_overview\' id=\'overview_test\'>\\n\\n<CustomListItem>\\n\\n<ChangelogComponent>\\n\\nimport Overview from \\"../crw-data/overview/_changelog_overview.mdx\\";\\n\\n<Overview />\\n\\n</ChangelogComponent>\\n\\n</CustomListItem>\\n\\n</div>"},{"id":"2024-3q-summary","metadata":{"permalink":"/en/blog/2024-3q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-3q-summary.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2024-3q-summary.mdx","title":"Third quarter guidance","description":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 3rd quarter services in 2024. Take a look at new features offered by WhaTap at a glance.","date":"2024-10-21T09:30:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"2024","permalink":"/en/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-3q-summary","title":"Third quarter guidance","authors":"ysj","date":"2024-10-21T09:30","toc_max_heading_level":2,"tags":["New features","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"Service overview","permalink":"/en/blog/overview"},"nextItem":{"title":"Second quarter guidance","permalink":"/en/blog/2024-2q-summary"}},"content":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 3rd quarter services in 2024. Take a look at new features offered by WhaTap at a glance.\\n\\n{/* \uC0C8\uB85C\uC6B4 \uAE30\uB2A5 sc \uC774\uBBF8\uC9C0 \uAD6D\uBB38\uACFC \uC601\uBB38 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n| **Common** |\\n| ---------- |\\n\\n> - The <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> menu has been improved.\\n> - The `Application`, `Kubernetes`, and `Database` product suites newly provided the <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> menu. \\n\\n| **Application** |\\n| --------------- |\\n\\n> Common menus such as <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> have been improved.\\n\\n| **Server** |\\n| ---------- |\\n\\n> - The Unix **HP-UX** installation package has been provided.\\n> - The <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> menu has been newly provided.\\n\\n| **Kubernetes** |\\n| -------------- |\\n\\n> - New menus such as <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, and <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" /> have been added, and the existing <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> menu has been improved.\\n> - The <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> and <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> features have been newly provided.\\n> - The <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> menu has been newly provided.\\n\\n| **Database** |\\n| ------------ |\\n\\n> - The <code class=\\"my\\">V2</code> services for `Oracle`, `Altibase`, and `Cubrid` products have been provided.\\n> - The **official** services for the `Oracle Pro` product have been provided. \\n> - The <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> menu has been newly provided.\\n> - The functionality of the <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> menu has been improved.\\n\\n{/* > * \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uACFC \uB370\uC774\uD130\uBCA0\uC774\uC2A4 \uC0C1\uD488 \uC5F0\uACC4 \uBAA8\uB2C8\uD130\uB9C1\uC744 \uC9C0\uC6D0\uD569\uB2C8\uB2E4. (10\uC6D4, 10\uC6D4\uC5D0 \uB610 \uD074\uB77C\uC6B0\uB4DC \uC9C0\uD45C \uAE01\uC5B4\uC624\uB294 \uAC70 \uAC00\uB2A5) */}\\n\\n| **Browser** |\\n| ----------- |\\n\\n> The functionality of the <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> feature has been stabilized.\\n\\n</div>\\n\\nAn overview of changes other than new features for each product, the corresponding release versions, and changes in the agent can be found in the following guide.\\n\\n<br/>\\n<br/>\\n\\n{/* \uACF5\uD1B5 \uBC0F \uBE0C\uB77C\uC6B0\uC800 \uBE84\uC9C0?? */}\\n\\n## `Common`\\n\\nIn the WhaTap `Common` section in Q3 2024, the <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> menu has been newly improved and the newly reorganized <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> menu has been introduced. \\n\\nThe searching feature has been added to the existing <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> menu and the new <Cmdname sid=\\"side_eventSettingV2\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> menu. You can search for events by entering a string based on <Cmdname sid=\\"event_title\\" className=\\"uitext\\" />, <Cmdname sid=\\"ITM07659\\" className=\\"uitext\\" /> in the search bar on the upper right of the event list, or by selecting the desired criteria from <Cmdname sid=\\"event_name\\" className=\\"uitext\\" /> or <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> and then entering a string. \\n\\n![Common event search branching example](/img/changelog/changelog-24q3-common1.png)\\n\\nThe `Application`, `Kubernetes`, and `Database` product suites newly reorganized the <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> menu. <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> is designed to enable monitoring tasks more efficient by significantly improving the user experience. \\n\\n![Common metrics chart v2 branching example](/img/changelog/changelog-24q3-common-metrics-chart.gif)\\n\\nYou can easily add charts by processing ***Time***, ***Target***, and ***Interval*** settings at a time. You can also freely change the time range of the dashboard widget, and the batch change and preset features make configuration management easier. In addition, you can freely adjust the dashboard layout and widgets, making chart analysis more efficient.\\n\\nThe following overview guide helps you understand what\'s new and what\'s not in the Common section for the 3rd quarter in 2024, along with the released versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Common_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Common.mdx\\";\\n\\n<Common_24q3 />\\n\\n</details>\\n\\n:::note \\n\\nFor more information about the <Cmdname sid=\\"side_metricsChart\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> menu, see [the following](../java/metrics-chart-v2).\\n\\n:::\\n\\n<br/>\\n\\n## `Application`\\n\\nNotable new features and major changes in the `Application` section of WhaTap Q3 2024 are provided, as well as improvements to common features. \\n\\nWhaTap Application Monitoring provides the <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> menu in the third quarter of this year, which allows you to view the URLs and number of calls made by specific IPs. Additionally, the feature to view the thread status of the application where the selected agent is installed and a column for CPU increase have been added to the <Cmdname sid=\\"side_threadList\\" className=\\"uitext\\" /> menu under the <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> menu. \\n\\n![Application branching example](/img/changelog/chagnelog-24q3-application.png)\\n\\nThe following overview guide helps you understand new features and major changes in the `Application` product suite in Q3, 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Application_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Application.mdx\\";\\n\\n<Application_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-java.mdx\\";\\n\\n<Java_agent_24q3 />\\n\\n<br/>\\n\\n### `PHP`\\n\\nimport PHP_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-php.mdx\\";\\n\\n<PHP_agent_24q3 />\\n\\n<br/>\\n\\n### `Node.js`\\n\\nimport Nodejs_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-nodejs.mdx\\";\\n\\n<Nodejs_agent_24q3 />\\n\\n<br/>\\n\\n### `Python`\\n\\nimport Python_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-python.mdx\\";\\n\\n<Python_agent_24q3 />\\n\\n<br/>\\n\\n### `.NET`\\n\\nimport DOTNET_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-dotnet.mdx\\";\\n\\n<DOTNET_agent_24q3 />\\n\\n<br/>\\n\\n### `Go`\\n\\nimport Go_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-golang.mdx\\";\\n\\n<Go_agent_24q3 />\\n\\n</details>\\n\\n:::info\\n\\n- The `Node.js` product provides the log monitoring.\\n\\n- `.NET` products support multi-transactions.\\n\\n:::\\n\\n:::note \\n\\n- For more information about the <Cmdname sid=\\"side_statIp\\" className=\\"uitext\\" /> menu, see [the following](../java/analysis-apm-trs#statiptx).\\n\\n- For more information on how to use the <Cmdname sid=\\"side_threadList\\" className=\\"uitext\\" /> menu, see [the following](../best-practice-guides/about-instance-performance-analysis#advanced-use-thread-list-dump).\\n\\n:::\\n\\n<br/>\\n\\n## `Server`\\n\\nNotable new features in the `Server` section of WhaTap Q3 2024 include the **Unix** `HP-UX` installation package and the new <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> menu. \\n\\nWhaTap Server Monitoring provides a new <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> menu in this third quarter. The <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> feature systematically manages the physical and virtual characteristics of the server, as well as the operation environment. Automatically collected server components and user-defined items allow you to understand and manage the server\'s configuration in detail. \\n\\n![Server components sc](/img/changelog/changelog-24q3-server-inventory.png)\\n\\nCustom columns can be configured through custom items to monitor the server status and performance in more detail and respond to issues. For example, you can add information about the operation managers for direct communication with each server manager, enabling a quick response upon an issue. Additionally, the <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> menu allows you to quickly filter servers that meet your criteria through three-level multi-sorting. The default sorting is performed based on ***OS type***, ***Model***, and ***Serial information***. \\n\\n**Unix** `HP-UX` agent installation package is provided. `HP-UX` is the high-performance Unix operating system developed by Hewlett-Packard (HP), known for its stability and performance on Itanium and PA-RISC systems. \\n\\n![Server monitoring installation page sc](/img/changelog/changelog-24q3-server-hp-ux.png)\\n\\nWhaTap supports `HP-UX` Itanium 11.23 and PA-RISC-UX 11.23. The `HP-UX` installation package can be easily installed with just a simple downloading and execution, and you can effectively manage and monitor the `HP-UX` operating system through WhaTap Server Monitoring.\\n\\nThe following overview guide helps you see the new features and major changes in the `Server` products in Q3 2024 along with the release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Server_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Server.mdx\\";\\n\\n<Server_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Server_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-server.mdx\\";\\n\\n<Server_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\nFor more information about the <Cmdname sid=\\"side_serverInventory\\" className=\\"uitext\\" /> menu, see [the following]( ../server/server-inventory).\\n\\n:::\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\nNotable new features and changes in the `Kubernetes` section of WhaTap Q3 2024 include new features such as <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> \uBC0F <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" />, and <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> . \\n\\nWhaTap Kubernetes Monitoring provides numerous new features in this Q3, along with the node monitoring expansion. New menus such as <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, and <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" /> have been added, and the existing <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> menu has been improved more efficiently.\\n\\nYou can monitor the node status from the cluster perspective via <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" />. You can intuitively see the real-time status of nodes, resource usage, and relationships between nodes, and you can customize the dashboard to suit your preferences through the settings such as grouping, threshold settings, and labels.\\n\\n<ImgLang img=\'k8s-node-map-custom.png\' desc=\'k8s node map branching example\' />\\n\\nIn <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" />, you can trace the node status changes over time. For example, you can visually see the time when a specific node is removed and its status at the time point. This is useful for analyzing issues that occurred during cluster operation or past situations checking.\\n\\n<ImgLang img=\'k8s-node-timeline-stage.png\' desc=\'k8s node timeline branching example\' />\\n\\nYou can monitor the status of individual disks mounted on the node in real time via <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" />. And the comparison and detailed information search of the existing <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> menu have been improved. Instead of moving to the <Cmdname sid=\\"side_nodeDetail\\" className=\\"uitext\\" /> menu, the configuration, resources, metrics, and events for the selected node can be checked via the <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> detail modal.\\n\\nAdditionally, WhaTap Kubernetes component analysis feature has been improved. The <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> and <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> features have been newly provided to enable comprehensive analysis of the performance and status of each component. You can see the summary analysis information in the <Cmdname sid=\\"TTL06782\\" className=\\"uitext\\" /> tab of <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />. \\n\\n![k8s performance summary branching example](/img/changelog/changelog-24q3-k8s-summary.gif)\\n\\nIn addition, as part of the expansion of WhaTap Kubernetes monitoring information, the new <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> menu has been added, allowing you to check the configuration of each service and the status of the connected Pods. It provides service information collected over the past 1 minute based on the query time. \\n\\n<ImgLang img=\'k8s-service-list.png\' desc=\'k8s Service list branching example\' />\\n\\nThrough the following overview guide, check the new features and major changes in the `Kubernetes` product in Q3 2024 along with the release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Kubernetes_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Kubernetes_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-k8s.mdx\\";\\n\\n<Kubernetes_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about the <Cmdname sid=\\"side_nodeMap\\" className=\\"uitext\\" /> menu, see [the following](../kubernetes/node-map).\\n\\n- For more information about the <Cmdname sid=\\"side_nodeTimeline\\" className=\\"uitext\\" /> menu, see [the following](../kubernetes/node-timeline).\\n\\n- For more information about the <Cmdname sid=\\"side_nodeDiskList\\" className=\\"uitext\\" /> menu, see [the following](../kubernetes/node-disk-list).\\n\\n- For more information about the <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"container\\" /> and <Cmdname sid=\\"TTL08317\\" className=\\"uitext\\" type=\\"kube_pod\\" /> features, see [the following](../kubernetes/container-map-target-info#kube-resource-summary-analysis).\\n\\n- For more information about the <Cmdname sid=\\"side_kubeServiceList\\" className=\\"uitext\\" /> menu, see [the following](../kubernetes/service-list).\\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\nIn the `Database` section of WhaTap Q3 2024, the official release of **Oracle Pro**, the release of **Oracle**, **Altibase**, and **Cubrid** products <code class=\\"my\\">V2</code>, the addition of the new <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> menu, and improved functionality of the <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> menu have been introduced.\\n\\nThe WhaTap database product suite is transitioning to <code class=\\"my\\">V2</code>. Following **Redis** and **MongoDB** in Q1, **Oracle**, **Altibase**, and **Cubrid** <code class=\\"my\\">V2</code> services have been launched in Q3. The <code class=\\"my\\">V2</code> had a changed structure for the data transfer pack and its UI has been improved overall. \\n\\n![Oracle new branching example](/img/changelog/changelog-24q2-db.png) \\n\\nThe official service to **Oracle Pro** has been launched. WhaTap **Oracle Pro** monitors the performance metrics by directly accessing the memory of the database server, collecting up-to-date performance information up to 20 times per second. It minimizes the system load by not going through disk I/O and provides precise performance analysis including the query execution time and buffer cache status.\\n\\n<ImgLang img=\'db-multi-instance-oracle-pro.png\' desc=\'Oracle v2 new branching example\' />\\n\\nAnd in <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" />, the new <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> feature has been provided. <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> helps you manage SQL scripts. You can save scripts in the agent installation path and fetch and execute them in real time by the monitoring service. This allows you to automate complex database tasks and monitor them easily.\\n\\n![Script manager branching example](/img/changelog/changelog-24q3-db-scm.png)\\n\\nIt also provides new custom widgets along with improvements to the <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> menu. In addition to the metrics provided by default on the dashboard, you can add the desired metrics.\\n\\n![Custom widget branching example](/img/changelog/changelog-24q3-db-custom.png)\\n\\nThe following overview guide helps you understand new features and major changes in the `Database` product suite in Q3 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Database_24q3 from \\"../crw-data/crwld-service-24q3/_import-24q3-service-Database.mdx\\";\\n\\n<Database_24q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `DBX`\\n\\nimport DBX_agent_24q3 from \\"../crw-data/crwld-agent-24q3/_import-agent-24q3-dbx.mdx\\";\\n\\n<DBX_agent_24q3 />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about the **Oracle Pro** products, see [the following](../oracle-pro/monitoring-intro).\\n\\n- For more information about new features in **Oracle** <code className=\\"my\\">V2</code>, see [the following](../oracle/monitoring-intro#new-feature).\\n\\n- For more information about new feature of the **Altibase** <code className=\\"my\\">V2</code>, see [the following](../altibase/monitoring-intro#new-feature).\\n\\n- For more information about new features of **CUBRID** <code className=\\"my\\">V2</code>, see [the following](../cubrid/monitoring-intro#new-feature).\\n\\n- For more information about the <Cmdname sid=\\"side_dbScriptManager\\" className=\\"uitext\\" /> feature, see [the following](../reference/script-manager).\\n\\n- For more information about the custom widgets of the <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> menu, see [the following](../oracle/multi-instance-monitoring#customwidget).\\n\\n:::\\n\\n<br/>\\n\\n## `Feature`\\n\\nWhaTap launched the **Beta** services for `Aerospike` monitoring and `Apache Pulsar` monitoring in the form of feature projects (<code class=\'Features\'>Features</code>) in Q3 2024. It is scheduled for official release in the future, and the support scope is to be expanded. \\n\\n![Feature project branching example](/img/changelog/changelog-24q3-feature.png) \\n\\n:::note \\n\\n- For more information about the <code class=\\"Beta\\">Beta</code> `Aerospike` monitoring, see [the following](../features/aerospike-introduction).\\n\\n- For more information about the <code class=\\"Beta\\">Beta</code> `Apache Pulsar` monitoring, see [the following](../features/apache-pulsar-introduction).\\n\\n:::\\n\\n<br/>"},{"id":"2024-2q-summary","metadata":{"permalink":"/en/blog/2024-2q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-2q-summary.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2024-2q-summary.mdx","title":"Second quarter guidance","description":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 2nd quarter services in 2024. Take a look at new features offered by WhaTap at a glance.","date":"2024-07-09T09:30:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"2024","permalink":"/en/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-2q-summary","title":"Second quarter guidance","authors":"ysj","date":"2024-07-09T09:30","toc_max_heading_level":2,"tags":["New features","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"Third quarter guidance","permalink":"/en/blog/2024-3q-summary"},"nextItem":{"title":"First quarter guidance","permalink":"/en/blog/2024-1q-summary"}},"content":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 2nd quarter services in 2024. Take a look at new features offered by WhaTap at a glance.\\n\\n{/* \uC0C8\uB85C\uC6B4 \uAE30\uB2A5 sc \uC774\uBBF8\uC9C0 \uAD6D\uBB38\uACFC \uC601\uBB38 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n| **Common** |\\n| ---------- |\\n\\n> Common menu improvements have been made for better convenience. \\n\\n| **Application** |\\n| --------------- |\\n\\n> - <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> has been further improved following the previous quarter.\\n> - A default preset changing feature has been added to <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />.\\n\\n| **Server** |\\n| ---------- |\\n\\n> - The installation screen has been reorganized to allow you to select the OS first when creating a server project.\\n> - The Unix **Oracle Solaris** installation package has been provided. \\n\\n| **Kubernetes** |\\n| -------------- |\\n\\n> - The <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> screen has been reorganized to provide an easier method to select options.\\n> - The <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> menu has been newly reorganized.\\n> - In the <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> menu, ***Resource Relationship Map*** has been provided.\\n\\n| **Database** |\\n| ------------ |\\n\\n> The **Oracle Pro** Beta service is available.  \\n\\n| **Browser** |\\n| ----------- |\\n\\n> A new <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> feature has been provided.\\n\\n</div>\\n\\nAn overview of changes other than new features for each product, the corresponding release versions, and changes in the agent can be found in the following guide.\\n\\n<br/>\\n<br/>\\n\\n{/* \uACF5\uD1B5 \uBC0F \uBE0C\uB77C\uC6B0\uC800 \uBE84\uC9C0?? */}\\n\\n## `Common`\\n\\nIn the second quarter of 2024, improvements have been made to the common menus, including <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />, for better convenience in the `Common` section. You can easily move groups in <Cmdname sid=\\"side_projectList\\" className=\\"uitext\\" /> of the side menu. For <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />, the ***Apply to all widgets in group*** feature that allows you to share options in the group, and the <Cmdname sid=\\"TLT06410\\" className=\\"uitext\\" /> feature in the group widget have been added. \\n\\n![Common branching example](/img/changelog/changelog-24q2-common.png)\\n\\nThe following overview guide helps you find new features and major changes in the Common section in Q2 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Common_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Common.mdx\\";\\n\\n<Common_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Application`\\n\\nNotable new features in the `Application` section of WhaTap in Q2 2024 include the improvements of <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> and the feature to change the default preset of <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" />, following the previous quarter (Q1).\\n\\nAs part of improvements of <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />, a new custom filtering feature has been provided that allows you to view only the selected items in the response time distribution chart. In the <Cmdname sid=\\"custom\\" className=\\"uitext\\" /> tab next to the ***TOP 30*** section, enter the desired value directly for a specific transaction, domain, or IP to search for, or select an item from the ***TOP 30*** list. The response time distribution of the selected items is filtered in real time on the chart.\\n\\n<p align=\\"center\\">\\n\\n![Transaction map custom filter branching example](/img/changelog/changelog-24q2-app-trs-map.gif)\\n\\n</p>\\n\\nYou can change the default dashboard preset that can be viewed when you first enter the <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> menu. It provides a more personalized user experience by setting the preferred dashboard configuration as the default preset. After modifying the widget selection and arrangement as desired, try using the <Cmdname sid=\\"BTN08106\\" className=\\"uitext\\" /> option in the preset selection box on the upper right of the dashboard. The dashboard designated as default is marked with the <code class=\'default-tag\'>default</code> tag in the preset list.\\n\\n![Application dashboard default preset branching example](/img/changelog/changelog-24q2-app-preset.png)\\n\\n{/* \uC774\uB97C \uD1B5\uD574 \uD074\uB77C\uC6B0\uB4DC \uBC0F \uCEE8\uD14C\uC774\uB108 \uAE30\uBC18 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC744 \uD3EC\uD568\uD55C \uB2E4\uC591\uD55C \uD50C\uB7AB\uD3FC\uACFC \uD658\uACBD\uC5D0\uC11C\uC758 \uBAA8\uB2C8\uD130\uB9C1\uC774 \uAC00\uB2A5\uD574\uC84C\uC2B5\uB2C8\uB2E4. <- \uC544\uC9C1 \uC548\uB428. \uB85C\uB4DC\uB9F5\uC5D4 \uC788\uC74C  */}\\n\\n{/* `.NET` \uC0C1\uD488\uC758 \uC9C0\uC6D0 \uBC94\uC704\uAC00 \uC708\uB3C4\uC6B0 \uC6B4\uC601\uCCB4\uC81C\uC5D0\uC11C \uC2E4\uD589\uB418\uB294 `.NET` \uD504\uB808\uC784\uC6CC\uD06C\uB9CC\uC774 \uC544\uB2C8\uB77C `.NET` \uCF54\uC5B4\uAE4C\uC9C0 \uD655\uB300\uB418\uC5B4 \uBCF4\uB2E4 \uB2E4\uC591\uD55C \uC6B4\uC601\uCCB4\uC81C \uAE30\uBC18 \uBAA8\uB2C8\uD130\uB9C1\uC744 \uC81C\uACF5\uD569\uB2C8\uB2E4. This aims to improve development and operation efficiency by enabling the monitoring in various environments, including cloud and container-based applications.  */}\\n\\n{/* * \uB2F7\uB137 \uD504\uB808\uC784\uC6CC\uD06C\uC5D0\uC11C \uB2F7\uB137 \uCF54\uC5B4(2\uBD84\uAE30 \uBAA8\uB2C8\uD130\uB9C1 \uC9C0\uC6D0 \uBC94\uC704 \uD655\uB300) */}\\n\\nThe following overview guide helps you check new features and major changes in the `Application` product suite for Q2 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Application_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Application.mdx\\";\\n\\n<Application_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-java.mdx\\";\\n\\n<Java_agent_24q2 />\\n\\n### `PHP`\\n\\nimport PHP_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-php.mdx\\";\\n\\n<PHP_agent_24q2 />\\n\\n### `Node.js`\\n\\nimport Nodejs_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-nodejs.mdx\\";\\n\\n<Nodejs_agent_24q2 />\\n\\n### `.NET`\\n\\nimport DOTNET_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-dotnet.mdx\\";\\n\\n<DOTNET_agent_24q2 />\\n\\n### `Go`\\n\\nimport Go_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-golang.mdx\\";\\n\\n<Go_agent_24q2 />\\n\\n</details>\\n\\n:::info\\n\\n**Old application dashboard service termination**\\n\\n***The old version of the <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> <code class=\'oldfunc\'>Old</code> menu accessed from the ***Sitemap**\\\\* **ends** its service on **July 24\\\\*\\\\* in the third quarter. Use the new <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> with improved features in the <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> menu. \\n\\n:::\\n\\n:::note \\n\\n- The support scope of the application `.NET` products has been expanded from the existing `.NET` framework to `.NET` Core. \\n\\n- For more information about the **Custom Filter** feature in the <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> menu, see [the following](https://docs.whatap.io/java/dashboard-transactionmap#custom).\\n\\n- For more information about changing the <Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> default preset, see [the following](https://docs.whatap.io/java/dashboard#changepreset).\\n\\n:::\\n\\n<br/>\\n\\n## `Server`\\n\\nNotable new features in the `Server` section of WhaTap Q2 2024 include improvements to the installation screen and the introduction to the **Unix** `Solaris` installation package. \\n\\nThe installation process for server monitoring products has been improved to be more intuitive. Instead of the previous method of separating tabs for each OS, user can now select an OS first and then an individual installation page tailored to the OS appears. \\n\\n![Server monitoring install page sc](/img/changelog/changelog-24q2-server.png)\\n\\nIn this Q2, a new **Unix** `Solaris` **agent installation package** is to be provided. Solaris that has been developed by Sun Microsystems, is a high-performance Unix operating system known for its scalability on SPARC systems and the features such as ZFS file system and DTrace. WhaTap supports Oracle Solaris 11.2 or later. You can install it simply by downloading the package by using the `Solaris` installation package and then running it. WhaTap Server Monitoring allows you to manage and monitor the `Solaris` operating system more effectively.\\n\\n{/* \uC11C\uBC84 \uBAA8\uB2C8\uD130\uB9C1 \uC0C1\uD488 \uC124\uCE58 \uC2DC \uC0AC\uC6A9\uC790\uAC00 \uC6B4\uC601 \uCCB4\uC81C\uB97C \uBA3C\uC800 \uC120\uD0DD\uD558\uC5EC \uBCF4\uB2E4 \uC9C1\uAD00\uC801\uC778 \uBC29\uC2DD\uC73C\uB85C \uC124\uCE58 \uACFC\uC815\uC774 \uC9C4\uD589\uB418\uB3C4\uB85D <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> \uD654\uBA74\uC774 \uAC1C\uC120\uB418\uC5C8\uC2B5\uB2C8\uB2E4. Instead of the previous OS-specific tab separating method, you can select an operating system and move to a separate installation page for the selected OS.  */}\\n\\n{/* \\\\* \uC5D0\uC774\uC804\uD2B8 \uC124\uCE58 \uD654\uBA74 \uD3B8\uC758\uC131 \uAC1C\uC120 > OS \uC120\uD0DD\\n\\n- Oracle Solaris \uC124\uCE58 \uD328\uD0A4\uC9C0 \uC81C\uACF5 */}\\n\\nThe following overview guide helps you check new features and major changes in the `Server` products in Q2 2024 along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Server_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Server.mdx\\";\\n\\n<Server_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Server_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-server.mdx\\";\\n\\n<Server_agent_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\nNotable new features and changes in the `Kubernetes` section of WhaTap Q2 2024 include the reorganization of <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" />, and the introduction to the <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> feature in <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />.\\n\\n{/* \uCFE0\uBC84\uB124\uD2F0\uC2A4 \uD50C\uB7AB\uD3FC\uC758 \uB2E4\uC591\uC131\uACFC \uB7F0\uD0C0\uC784 \uBC0F \uAE30\uB2A5\uC758 \uD655\uC7A5\uC5D0 \uB530\uB77C \uC5D0\uC774\uC804\uD2B8 \uC124\uCE58 \uACFC\uC815\uC758 \uC0C1\uC138\uB3C4 \uC5ED\uC2DC \uB192\uC544\uC84C\uC2B5\uB2C8\uB2E4. To address this, following the support for *Helm* chart installation in the previous quarter (Q1), the feature to automatically generate *YAML* files to install user environments and various WhaTap options in the second quarter. The agent installation process has been simplified and its usability has been greatly improved with an easy generation of agent installation file by selecting desired options in the UI.  */}\\n\\nDue to ongoing changes in Kubernetes products and emergence of various container runtimes, the agent installation process is also becoming more complex. Following the support for *Helm* chart installation in Q1, WhaTap provide a new Kubernetes <Cmdname sid=\\"agentInstall\\" className=\\"uitext\\" /> feature in Q2. Previously, after downloading the *YAML* file for installation, there were cases where the items needed to be modified additionally. But now, when you select key components or features in the Kubernetes environment and features to use, appropriate installation files are provided in the UI. This makes it much faster and easier to install agents.\\n\\n<ImgLang img=\'k8s-install-master-node-download.png\' desc=\'Install file download branching example\' />\\n\\n{/* <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" />\uC5D0\uC11C \uC81C\uACF5\uD558\uB358 <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> \uBA54\uB274\uAC00 V2\uB85C \uAC1C\uD3B8\uB418\uBA70 <Cmdname sid=\\"side_workload\\" className=\\"uitext\\" /> \uD558\uC704 \uBA54\uB274\uB85C \uC7AC\uAD6C\uC131\uB418\uC5C8\uC2B5\uB2C8\uB2E4. The feature has been significantly improved for provision of one-time pending information as follows. The <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> V2 provides real-time visibility into a Pod in pending status along with the related data that enables root cause analysis. This allows you to systematically monitor and analyze Pods in pending status in the cluster.  */}\\n\\nThe <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> feature provided under the <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" /> menu has been reorganized into <code class=\\"my\\">V2</code> and the sub menu of <Cmdname sid=\\"side_workload\\" className=\\"uitext\\" /> has been officially released. The <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> feature provides real-time visibility into a Pod in Pending status, along with the related data that enables root cause analysis. This helps increase the availability of clusters and services.\\n\\n<ImgLang img=\'k8s-pending-pod-status-detail.png\' desc=\'Pending Pod Detail branching example\' />\\n\\n{/* \uC640\uD0ED \uCFE0\uBC84\uB124\uD2F0\uC2A4 \uBAA8\uB2C8\uD130\uB9C1\uC740 2024\uB144 \uC0C1\uBC18\uAE30\uC5D0 \uAC78\uCCD0 <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> \uAC1C\uC120 \uC791\uC5C5\uC744 \uC9C4\uD589\uD574 \uC654\uC2B5\uB2C8\uB2E4. In this second quarter, the <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> detail <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> feature has been added. The <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> tab makes it easier to visually see the hierarchy and relationships between resources. This allows you to clearly see the resource structure and interactions in the cluster, check the resource status and location, and respond quickly when any issue occurs.  */}\\n\\nWhaTap Kubernetes Monitoring has undergone continuous <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> improvements throughout the first half of 2024. In the second quarter, the <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> feature has been added to <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />. The <Cmdname sid=\\"TTL07237\\" className=\\"uitext\\" /> feature allows you to visually check the hierarchy and relationships between Kubernetes resources, allowing you to analyze the Kubernetes environment and identify the cause and impact at a glance when a problem occurs.\\n\\n<p align=\\"center\\">\\n\\n![Resource relations branching example](/img/k8s-container-detail-rr-s.png)\\n\\n</p>\\n\\n{/* \uCFE0\uBC84\uB124\uD2F0\uC2A4 \uB9AC\uC18C\uC2A4\uAC04 \uC5F0\uACB0 \uAD00\uACC4\uB97C \uC2DC\uAC01\uC801\uC73C\uB85C \uD655\uC778\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \\n\\nIt provides users with a visual representation of the hierarchy and relationships between resources in the Kubernetes cluster. This allows users to easily see at a glance on which node a Pod or Container is running, by which deployment it is released, and to which namespace it belongs.\\n\\n- Improved system understanding: Visualized information provides a clear understanding of the resource structure and interactions across the entire cluster.\\n\\n- Issue diagnosing and quick response: The status and location of each resource can be visually checked to quickly respond when issues occur.\\n\\n- Efficiency in resource management: It optimizes the placement and interactions for cluster resources and improves the operation efficiency.\\n\\nThis feature enables efficiency and rapid troubleshooting during cluster operation and management. */}\\n\\n{/* \uC2E4\uC2DC\uAC04\uC73C\uB85C Pending \uC0C1\uD0DC\uC758 Pod \uD604\uD669\uC744 \uC870\uD68C\uD560 \uC218 \uC788\uC73C\uBA70, \\n\\nThe <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> V2 allows you to comprehensively monitor and analyze the status of Pods in pending status within the cluster.\\n\\nIt allows you to comprehensively monitor and analyze Pods in pending status within the cluster.\\n\\nIt allows you to comprehensively monitor and analyze Pods in pending status within the cluster. You can check the status of Pods in pending status in real time and analyze the cause of the status for each Pod in detail  \\n\\n and provides more comprehensive information through real-time visibility, root cause analysis, and associated data provision. \\n\\nYou can visually check the resource relationships in the container map details. */}\\n\\n{/* \\\\* \uC5D0\uC774\uC804\uD2B8 \uC124\uCE58 \uAC1C\uC120: \uC5D0\uC774\uC804\uD2B8 \uC124\uCE58 \uBCF5\uC7A1\uB3C4 \uC99D\uAC00(k8s \uD50C\uB7AB\uD3FC, \uB7F0\uD0C0\uC784, \uAE30\uB2A5 \uC99D\uAC00) -> ui\uC0C1\uC5D0\uC11C \uC0AC\uC6A9\uC790 \uD658\uACBD \uBC0F \uAE30\uB2A5\uC744 on/off \uC124\uC815 \uC2DC \uC124\uCE58 yaml \uD30C\uC77C \uB610\uB294 helm \uCC28\uD2B8 \uC790\uB3D9 \uC0DD\uC131\uD574 \uC5D0\uC774\uC804\uD2B8 \uC124\uCE58 \uB09C\uC774\uB3C4 \uBC0F \uC0AC\uC6A9\uC131 \uAC1C\uC120\\n\\n- Automatically provides the yaml for installation of each user environment and various WhaTap options.\\n\\n- Pending Pod status V2: It provides one-time pending information upon user request -> Improvement in service availability by providing visibility of Pods in pending status and various associated data for the cause of occurrence. \\n\\n  - Switched to collection mode.\\n\\n  - Embedded the dedicated dashboard and analysis feature. \\n\\n- \uCEE8\uD14C\uC774\uB108 \uB9F5 \uB9AC\uC18C\uC2A4 \uAD00\uACC4\uB3C4 */}\\n\\nThe following overview guide helps you check new features and major changes in the `Kubernetes` products in Q2 2024 along with their release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Kubernetes_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Kubernetes_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-k8s.mdx\\";\\n\\n<Kubernetes_agent_24q2 />\\n\\n</details>\\n\\n:::note \\n\\nFor more information about <Cmdname sid=\\"side_pendingPod\\" className=\\"uitext\\" /> <code class=\\"my\\">V2</code>, see [the following](https://docs.whatap.io/kubernetes/pending-pod-status).\\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\nWhaTap is now announcing notable new features and changes in the `Database` section in Q2 2024, including the launch of **Oracle** product <code class=\\"my\\">V2</code> and the Beta launch of **Oracle Pro**. \\n\\nThe WhaTap database product suite is transitioning to <code class=\\"my\\">V2</code>. Following **Redis** and **MongoDB** in Q1, the transition to the **Oracle** <code class=\\"my\\">V2</code> has begun in Q2. \\n\\n![Oracle new branching example](/img/changelog/changelog-24q2-db.png) \\n\\nThe **Oracle Pro** **Beta** service has launched in preparation for the official release in Q3. **Oracle Pro** has applied the technologies to monitor the performance metrics by directly accessing the memory of the database server. It can monitor accurate performance information up to 20 times per second by reflecting the latest data, and can minimize the load on the system by directly accessing memory without using the disk I/O. This allows you to quickly and accurately analyze issues based on the precisely collected performance data, such as execution time for a specific query and status of the buffer cache.\\n\\n{/* \\\\* Oracle Pro\\n\\n- Oracle <code class=\\"my\\">V2</code>\\n\\n- \uBA40\uD2F0 \uC778\uC2A4\uD134\uC2A4 \uBAA8\uB2C8\uD130\uB9C1 \uBA54\uB274 \uC0AC\uC6A9\uC790 \uD3B8\uC758\uC131 \uAC1C\uC120  */}\\n\\n{/* oracle pro\uC758 \uACBD\uC6B0 7\uC6D4 \uC815\uC2DD \uC11C\uBE44\uC2A4 \uBC30\uD3EC \uC608\uC815 */}\\n\\nThe following overview guide helps you check new features and major changes in the `Database` product suite for Q2 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Database_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Database.mdx\\";\\n\\n<Database_24q2 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `DBX`\\n\\nimport DBX_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-dbx.mdx\\";\\n\\n<DBX_agent_24q2 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\nWhaTap introduces <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> as a notable new feature in the `Browser` section for Q2 2024. It may be difficult to accurately reproduce the failures with just the list of events. The <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> feature allows you to automatically record and play every event users perform on the website. \\n\\nThe interactions can be analyzed between the website and users by accurately reproducing every event, such as user clicks, scrolls, inputs, and page transitions. This enables real user experiences, allowing you to quickly identify and resolve potential issues, and provides insights into how users use the website and which can help you optimize it. \\n\\n![Session replay sc](/img/changelog/changelog-24q2-browser1.png)\\n\\n{/* \\n\\n![Session replay player](/img/browser-session-replay-player.png)\\n\\nIt provides insights into how users use the website. This helps us understand and optimize user interactions. \\n\\nYou can reproduce user behaviors that allow you to understand exactly how users interact with the website and its environment.  \\n\\nIt may be difficult to reproduce failures with just the list of events. When an actual failure occurs, the user\'s screen can be recorded to allow for more accurate failure reproduction.  */}\\n\\n<code class=\\"Feature\\">Feature</code> In <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />, and <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" />, added the <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> feature. <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_6_x\\"><code class=\'changelog-service\'>Service 2.6.0\u200B</code></a></code>\\n\\n{/* <details className=\'changelog\'>\\n\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Browser_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Browser.mdx\\";\\n\\n<Browser_24q2 />\\n\\n</details> */}\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Browser_agent_24q2 from \\"../crw-data/crwld-agent-24q2/_import-agent-24q2-browser.mdx\\";\\n\\n<Browser_agent_24q2 />\\n\\n</details>\\n\\n:::note \\n\\nFor more information about the <Cmdname sid=\\"TTL08103\\" className=\\"uitext\\" /> function, see [the following](https://docs.whatap.io/browser/session-replay).\\n\\n:::\\n\\n{/* ## `Cloud`\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Cloud_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Cloud.mdx\\";\\n\\n<Cloud_24q2 />\\n\\n</details> */}\\n\\n<br/>\\n\\n## `Feature`\\n\\nIt introduces a new `Feature` project to be provided in the second quarter of 2024. WhaTap has introduced **Feature Project** so that users can easily check whether the desired software supports monitoring and easily start monitoring. The Feature Project provides an optimized monitoring solution by repackaging existing monitoring products to fit the software to monitor. \\n\\nThe **Beta** service of `KAFKA` monitoring has been launched using the feature project manner. It is scheduled for official release in the future, and the support for the scope other than `KAFKA` is to be expanded. \\n\\n![Feature project branching example](/img/changelog/changelog-24q2-feature1.png) \\n\\n{/* \uC640\uD0ED \uD53C\uCCD0 \uD504\uB85C\uC81D\uD2B8\uB97C \uD1B5\uD574 \uC11C\uBE44\uC2A4\uC758 \uC548\uC815\uC131\uACFC \uC131\uB2A5\uC744 \uB354\uC6B1 \uD6A8\uACFC\uC801\uC73C\uB85C \uAD00\uB9AC\uD574 \uBCF4\uC138\uC694. */}\\n\\n{/* <code class=\\"Beta\\">Beta</code> `KAFKA` \uBAA8\uB2C8\uD130\uB9C1 **\uBCA0\uD0C0** \uC11C\uBE44\uC2A4 \uC2DC\uC791  */}\\n\\n:::note \\n\\nFor more information about the feature project and `KAFKA` monitoring, see [the following](https://docs.whatap.io/features/kafka-introduction). \\n\\n:::\\n\\n<br/>\\n\\n{/* <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_6_x\\"><code class=\'changelog-service\'>Service 2.6.0\u200B</code></a></code> */}\\n\\n## `URL`\\n\\nWhaTap introduces the changes to the `URL` section in Q2 2024. The UI of the <Cmdname sid=\\"side_urlList\\" className=\\"uitext\\" /> menu and the <Cmdname sid=\\"edit_url\\" className=\\"uitext\\" /> window in that menu has been comprehensively reorganized to improve usability. In addition, <Cmdname sid=\\"TTL07886\\" className=\\"uitext\\" /> has been changed so that it can be deleted when viewing the list, not in the editing window. In case of ***URL Detail***window, it is provided in a pop-out manner for easy comparison.\\n\\n![URL sc](/img/changelog/changelog-24q2-url.png)\\n\\n{/* * \uC5D0\uB7EC \uC720\uD615 \uC548\uB0B4 \uBB38\uC11C\uAC00 \uC0C8\uB85C \uC5C5\uB370\uC774\uD2B8\uB418\uC5C8\uC2B5\uB2C8\uB2E4. For more information, see [the following](https://docs.whatap.io/url/url-error-type).  */}\\n\\n{/* \uBD80\uBD84\uC758 \uC8FC\uBAA9\uD560 \uB9CC\uD55C \uC2E0\uADDC \uAE30\uB2A5\uC73C\uB85C ~\uC744 \uC18C\uAC1C\uD569\uB2C8\uB2E4.\\n\\n- A detail window pop-out with an improved interface\\n\\n- \uC0C1\uD0DC \uCF54\uB4DC \uBB38\uC11C \uC548\uB0B4(\uCCA8\uC5B8) */}\\n\\nThe following overview guide helps you check the major changes to the `URL` products in Q2 2024 along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport URL_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-URL.mdx\\";\\n\\n<URL_24q2 />\\n\\n</details>\\n\\n:::note \\n\\nThe **URL status code types** guide has been added. For more information, see [the following](https://docs.whatap.io/url/url-http-status). \\n\\n:::\\n\\n<br/>\\n\\n{/* ## `Log`\\n\\nWhaTap introduces a notable new feature xx in the `Log` section in Q2 2024.\\n\\n- Changing the way to display the accumulated number of cases when viewing the logs\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Log_24q2 from \\"../crw-data/crwld-service-24q2/_import-24q2-service-Log.mdx\\";\\n\\n<Log_24q2 />\\n\\n</details> */}"},{"id":"2024-1q-summary","metadata":{"permalink":"/en/blog/2024-1q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-1q-summary.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2024-1q-summary.mdx","title":"First quarter guidance","description":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s first quarter services in 2024. Take a look at new features offered by WhaTap at a glance.","date":"2024-05-20T15:30:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"2024","permalink":"/en/blog/tags/2024"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2024-1q-summary","title":"First quarter guidance","authors":"ysj","date":"2024-05-20T15:30","toc_max_heading_level":2,"tags":["New features","2024"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"Second quarter guidance","permalink":"/en/blog/2024-2q-summary"},"nextItem":{"title":"What\'s new?","permalink":"/en/blog/index"}},"content":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s first quarter services in 2024. Take a look at new features offered by WhaTap at a glance.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n{/* truncate */}\\n\\n{/* \uBA3C\uC800 1\uBD84\uAE30 \uC0C1\uD488\uBCC4 \uC2E0\uADDC \uAE30\uB2A5 \uBC0F \uC2E0\uADDC \uC0C1\uD488 \uC694\uC57D\uC740 \uB2E4\uC74C\uACFC \uAC19\uC2B5\uB2C8\uB2E4. The side menu has been reorganized and the dashboard has been improved.  */}\\n\\n{/* \uC694\uC57D\uC740 \uB2E4\uC2DC \uC368\uC57C \uD568 */}\\n\\n<div class =\'faq\'>\\n\\n| **Common** |\\n| ---------- |\\n\\n> - The **Side Menu** has been reorganized.  \\n> - The <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> feature has been newly provided to enhance the metrics field-centeric user experience. \\n> - The **SSO account linking** feature has been added.\\n\\n| **Application** |\\n| --------------- |\\n\\n> - The menu structures of <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> have been improved.\\n> - <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> has been improved.\\n> - The `Go` product\'s Beta service has been terminated and the **official** service has been provided.\\n\\n| **Server** |\\n| ---------- |\\n\\n> The Unix **AIX** agent installation package has been provided. \\n\\n| **Kubernetes** |\\n| -------------- |\\n\\n> - **Control plane monitoring** has been newly provided. The <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> features have been added for monitoring the kube-apiserver among control plane components. \\n> - The Pod initialization performance and master meta data features have been reorganized to provide the <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> features. \\n> - The <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" /> feature that allows you to search for related information based on the deployment, and the <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> feature that allows you to check the installation status of master and node agents, have been added. \\n> - Support for *Helm* chart installation has been provided when installing the master and node agents. \\n\\n| **Database** |\\n| ------------ |\\n\\n> - A new <code class=\\"my\\">V2</code> service has been provided that enhances charting and collection features in `MongoDB` and `Redis` products.\\n> - The metrics divided into XOS and XOS2 have been integrated into **XOS** and changed to be displayed in percentage. \\n\\n| **Browser** |\\n| ----------- |\\n\\n> The <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> feature has been newly provided.\\n\\n| **Network** |\\n| ----------- |\\n\\n> The **Network Performance Monitoring** product has been **officially** released. \\n\\n</div>\\n\\nAn overview of changes other than new features for each product, the corresponding release versions, and changes in the agent can be found in the following guide.\\n\\n<br/>\\n<br/>\\n\\n## `Common`\\n\\nNotable new features in the `Common` section in Q1 2024 include a reorganized side menu, addition of the SSO account link, and a new event configuration feature. \\n\\nFor better user convenience, the **side menu** of WhaTap Monitoring has been reorganized for the first time in 5 years. Project selection is required before using the WhaTap services. In order to make it easier to use the work flow after creating and selecting a project, the UI has been reorganized to reduce clutter compared to before, securing the area for project selection and menu space. \\n\\nYou can expand only the selected part of the project list for checking, and secure the vertical area to view various feature menus more easily. You can also bookmark frequently used functions in the product-specific project menu by clicking a simple star-shaped icon (<LinkImage img=\'ic-star.svg\' desc=\'Compare Icon\'/>). \\n\\n<ImgLang img=\'release/release-main-ui.png\' desc=\'Reorganize side menu cl branching example\' />\\n\\nIn addition, the **SSO account link feature** has been added. You can integrate WhaTap Monitoring with **Okta** that is a cloud-based user account management and access rights management solution. You can use the service after logging into the WhaTap service with the **Okta** account that is used in the organization. \\n\\n<ImgLang img=\'sso-check-sso-info.png\' desc=\'sso-info cl quarterly example\' />\\n\\nThe <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code> feature has enhanced the field-centric user experience by allowing users to select fields before categories, thus eliminating the mismatch between metrics perceived by users and event settings. The default event templates have been provided for your products, making it easier to configure the alert events. \\n\\n![Event v2 cl branching example](/img/changelog/changelog-common-event-v2.png)\\n\\nThe following overview guide helps you check new features and major changes in the Common section for Q1 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Common_1q from \\"../crw-data/crwld-service/_import-service-Common.mdx\\";\\n\\n<Common_1q />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about the side menu reorganization, see [the following](https://www.whatap.io/bbs/board.php?bo_table=blog&wr_id=214/). \\n\\n- For more information about the SSO account linking, see [the following](https://docs.whatap.io/account/sso/). \\n\\n- For more information about <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> <code class=\\"newfunc\\">New</code>, see [the following](https://docs.whatap.io/java/warning-notice-v2). \\n\\n:::\\n\\n<br/>\\n\\n## `Application`\\n\\nNotable new features and changes in the `Application` product suite in Q1 2024 include the official release of the `Go` product, enhancements to <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" />, and improvements to the menu structures of <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" />.  \\n\\nThe `Go` application monitoring has started **official** service after ending the Beta version. WhaTap\'s `Go` application monitoring supports web frameworks and continuously collects the Go runtime package data. The call relationships are collected through link tracing in the MSA environment. \\n\\nThe <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> menu allows you to check the detailed status of each transaction for a short period during a performance test or upon occurrence of a failure. Enhancements have been made to <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> as follows.\\n\\nInstead of removing the TX Trace section, the structure has been improved to provide detailed information through the <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> popup window when dragging the chart. Additionally, the number of analyzed traces has been expanded from 100 to **1000**, enabling analysis of 10 times more traces than before. \\n\\nIn addition, the **Filter** feature has been improved to minimize behaviors by applying filters on a single screen. For example, you can use transaction filters to filter and view only the selected transactions. In addition, overall convenience has been improved by allowing you to view data from up to 10 minutes, in addition to the previous real-time data inquiry of up to 5 minutes.  \\n\\n {/* \uADF8\uC678\uC5D0\uB3C4 ***Top 30*** \uC139\uC158\uC5D0 IP \uD544\uD130 \uAE30\uB2A5\uC744 \uCD94\uAC00\uD588\uACE0, <Cmdname sid=\\"multi_transaction\\" className=\\"uitext\\" /> \uD0ED\uC5D0\uC11C \uD504\uB85C\uC7AD\uD2B8 \uC120\uD0DD \uC0C1\uD0DC\uB97C \uC800\uC7A5\uD558\uB294 \uB4F1 \uD2B8\uB79C\uC7AD\uC158 \uBD84\uC11D \uC2DC \uD3B8\uC758\uC131\uC744 \uC804\uBC18\uC801\uC73C\uB85C \uD5A5\uC0C1\uC2DC\uCF30\uC2B5\uB2C8\uB2E4.  */}\\n\\n<ImgLang img=\'changelog/changelog-app-tx-map.png\' desc=\'sc\' className=\'changelog-img\'/>\\n\\nFor <Cmdname sid=\\"side_statistics\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_agentsConfiguration\\" className=\\"uitext\\" /> menus, improvements have been made in the work flow and stability, such as tab configuration for each menu into individual submenus.\\n\\n![Statistics and instance performance monitoring sc cl](/img/changelog/changelog-app-stat-instance.png)\\n\\n{/* \uC548\uC815\uC801\uC73C\uB85C \uAC01 \uAE30\uB2A5\uC744 \uC0AC\uC6A9\uD560 \uC218 \uC788\uB3C4\uB85D / \uAE30\uC874 \uBB38\uC81C \uAC1C\uC120 \uBC0F \uB2E4\uC591\uD55C \uC548\uC815\uD654 \uC791\uC5C5\uC744 \uC9C4\uD589\uD588\uC2B5\uB2C8\uB2E4. */}\\n\\nThe following overview guide helps you check new features and major changes in the `Application` product suite for Q1 2024, along with release versions.\\n\\n{/* <code class=\\"New\\">New</code> `Go` \uBAA8\uB2C8\uD130\uB9C1 \uC0C1\uD488 **\uC815\uC2DD \uC11C\uBE44\uC2A4** \uC2DC\uC791 <code class=\'changelog-service\'>Service 2.2.4\u200B</code> */}\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Application_1q from \\"../crw-data/crwld-service/_import-service-Application.mdx\\";\\n\\n<Application_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_1q from \\"../crw-data/crwld-agent/_import-agent-java.mdx\\";\\n\\n<Java_agent_1q />\\n\\n### `PHP`\\n\\nimport PHP_agent_1q from \\"../crw-data/crwld-agent/_import-agent-php.mdx\\";\\n\\n<PHP_agent_1q />\\n\\n### `Python`\\n\\nimport Python_agent_1q from \\"../crw-data/crwld-agent/_import-agent-python.mdx\\";\\n\\n<Python_agent_1q />\\n\\n### `Node.js`\\n\\nimport Node_agent_1q from \\"../crw-data/crwld-agent/_import-agent-nodejs.mdx\\";\\n\\n<Node_agent_1q />\\n\\n### `Go`\\n\\nimport Go_agent_1q from \\"../crw-data/crwld-agent/_import-agent-golang.mdx\\";\\n\\n<Go_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\nThe **Unix** `AIX` installation package with notable new features and changes in `Server` products in Q1 2024 of WhaTap. \\n\\nIn this Q1, a new **Unix** `AIX` **agent installation package** has been provided. AIX, developed by IBM, is primarily used on enterprise servers. It is an operating system specifically designed for scalability, compatibility, and robustness in enterprise environments. \\n\\nWhaTap supports **AIX 6.1** or later. You can install the package simply by downloading it via the `AIX` installation package and running it. WhaTap Server Monitoring enables you to manage and monitor the AIX operating system more effectively. \\n\\n![AIX sc cl](/img/changelog/changelog-server-aix.png)\\n\\nThe following overview guide helps you check new features and major changes in the `Server` products in Q1 2024 along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Server_1q from \\"../crw-data/crwld-service/_import-service-Server.mdx\\";\\n\\n<Server_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Server_agent_1q from \\"../crw-data/crwld-agent/_import-agent-server.mdx\\";\\n\\n<Server_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\nFor more information about the AIX installation, see [the following](https://docs.whatap.io/server/server-os/server-aix). \\n\\n:::\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\nHere are notable new features and changes in WhaTap\'s Q1 2024 Kubernetes products, including a new feature, **Control Plane Monitoring**, <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, reorganized feature, <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" />, and support for newly added **Helm** chart installation. \\n\\nWhaTap Kubernetes Monitoring has introduced **Control Plane Monitoring** in this Q1. The <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" /> features have been added to provide visibility into kube-apiserver, the control plane component that manages the entire Kubernetes cluster and handles API requests in the cluster. \\n\\n<Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" /> collects status and performance metrics of kube-apiserver, response times, throughputs, request failures, and such to monitor the availability and performance of the cluster. You can view the list of metrics collected by kube-apiserver via <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />.\\n\\n![Control Plane monitoring sc cl](/img/changelog/changelog-k8s-kube-apiserver.png)\\n\\nAdditionally, the <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" /> feature that allows you to query information based on Deployment, and the <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> feature that allows you to check the installation status of master and node agents, have been added. \\n\\nMonitoring the collection of Pods rather than individual Pods is important for ensuring service stability and performance. In this sense, deployment monitoring that is responsible for application deployment and updates, is essential. In <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, you can view resource relationships, status of pods, containers, and applications in the cluster, and key performance metrics such as CPU, memory, and number of transactions by Deployment. \\n\\nAdditionally, the newly added <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" /> allows you to see the master and node agent installation status at a glance.\\n\\nIn addition, the Pod initialization performance and master meta information have been reorganized to provide <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> features. <Cmdname sid=\\"side_podInitPerf\\" className=\\"uitext\\" /> provides data details on the startup time and resource usage through precise analysis of the startup times for each Pod. <Cmdname sid=\\"side_objectManifest\\" className=\\"uitext\\" /> adds historical view and comparison for each object, making it easy to trace changes in the cluster. \\n\\n![Object manifest and Pod startup analysis sc cl](/img/changelog/changelog-k8s-om-podinit.png)\\n\\n{/* \\n\\nIn addition, you can see the resource relationship diagram and core observability data such as traces, logs, and metrics at a glance based on the deployment. \\n\\n\uD074\uB7EC\uC2A4\uD130 \uAD00\uB9AC \uD6A8\uC728\uC131 \uD5A5\uC0C1 */}\\n\\nIn addition, support of the **Helm** chart installation method that reduces the operation complexity when installing master and node agents has been officially supported, in addition to the previous method using the Yaml file. \\n\\nThe following overview guide helps you check new features and major changes in the `Kubernetes` products in Q1 2024 along with their release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Kubernetes_1q from \\"../crw-data/crwld-service/_import-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Kubernetes_agent_1q from \\"../crw-data/crwld-agent/_import-agent-k8s.mdx\\";\\n\\n<Kubernetes_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about <Cmdname sid=\\"side_kubeApiserverDashboard\\" className=\\"uitext\\" />, see [the following](https://docs.whatap.io/kubernetes/kube-apiserver-dashboard).\\n\\n- For more information about <Cmdname sid=\\"side_kubeApiserverMetricsSearch\\" className=\\"uitext\\" />, see [the following](https://docs.whatap.io/kubernetes/kube-apiserver-metrics-search).\\n\\n- For more information about <Cmdname sid=\\"side_deploymentList\\" className=\\"uitext\\" />, see [the following](https://docs.whatap.io/kubernetes/deployment-list).\\n\\n- For more information about <Cmdname sid=\\"side_kubernetesAgentList\\" className=\\"uitext\\" />, see [the following](https://docs.whatap.io/kubernetes/agent-list).\\n\\n- For more information about the *Helm* chart installation for master and node agents, see [the following](https://docs.whatap.io/kubernetes/install-master-node-agent#create-kubernetes-agent). \\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\nWhaTap introduces notable new features and changes in the `Database` product suite in Q1 2024, including the launch of <code class=\\"my\\">V2</code> for **Redis** and **MongoDB** products.\\n\\nWhaTap\'s `Database` product suite is being transitioned to <code class=\\"my\\">V2</code>. Following the previous **PostgreSQL** and **MySQL**, **Redis** and **MongoDB** <code class=\\"my\\">V2</code> services have been launched in this first quarter. The <code class=\\"my\\">V2</code> features improved charting and collection features overall.  \\n\\n![Database sc cl ](/img/changelog/changelog-db.png)\\n\\nThe UI and features of the <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> menu have been improved, and you can now directly check the database performance metrics from the menu. You can also select agents for each cluster in <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" />. And it provides the <Cmdname sid=\\"side_log\\" className=\\"uitext\\" /> menu that allows you to search for database logs, check the trends, and receive log-related notifications.\\n\\nWith the transition to <code class=\\"my\\">V2</code>, the metrics divided into XOS and XOS2 are changed to percentage notation that can be checked as % and provided as an integrated version under **XOS*.\\n\\nThe following overview guide helps you check new features and major changes in the `Database` product suite for Q1 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Database_1q from \\"../crw-data/crwld-service/_import-service-Database.mdx\\";\\n\\n<Database_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport DBX_agent_1q from \\"../crw-data/crwld-agent/_import-agent-dbx.mdx\\";\\n\\n<DBX_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\nNotable new features and changes to the `Browser` products in Q1 2024 include the <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" /> feature and ***Custom event collection feature***. \\n\\nA new feature in this Q1, <Cmdname sid=\\"TTL07736\\" className=\\"uitext\\" />, can be used to check how users navigate web pages. By analyzing overall user behaviors--how they act, what pages they stay on, what elements they click on the screen, what errors occur on the screen, you can gain insights into how they use the service and get closer to understanding the behavioral patterns. \\n\\nYou can use <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" />, and <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" /> to analyze users\' on-page behaviors and trace various errors that occur in sessions. Session log information can be used to analyze end users\' paths, causes for attrition, performance, and user experience. You can also use ***AJAX hitmap*** and <Cmdname sid=\\"side_rumPageLoadHitmap\\" className=\\"uitext\\" /> to identify users who are having issues in real time. This information allows us to check user experience with services and performance status.\\n\\n<ImgLang img=\'browser-search-user-session-log-analysis.png\' desc=\'User session analysis branching example\' className=\'changelog-img\'/>\\n\\nThe ***Custom event collection*** feature provides an interface for users to collect desired events as well as basic information provided by Browser Monitoring. You can collect custom events using the `addCustomEvent` method among the interfaces provided by the browser agents, and then view the collected data through the <Cmdname sid=\\"side_userSessionEventSearch\\" className=\\"uitext\\" /> menu or <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />. \\n\\n{/* \uC0AC\uC6A9\uC790\uAC00 \uC6F9 \uD398\uC774\uC9C0\uB97C \uD0D0\uC0C9\uD558\uB294 \uBC29\uC2DD\uC744 \uC774\uD574\uD560 \uC218 \uC788\uB3C4\uB85D \uB3D5\uC2B5\uB2C8\uB2E4. You have insights with an aid of this.   */}\\n\\nThe following overview guide helps you understand new features and major changes in `Browser` products in Q1 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Browser_1q from \\"../crw-data/crwld-service/_import-service-Browser.mdx\\";\\n\\n<Browser_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Browser_agent_1q from \\"../crw-data/crwld-agent/_import-agent-browser.mdx\\";\\n\\n<Browser_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\nIn the first quarter of 2024, WhaTap officially launched its **Network Performance Monitoring** product, which collects network data for processes to identify congestion and failures between networks and improve users\' network performance. \\n\\n![Network monitoring cl ](/img/changelog/changelog-network.png)\\n\\nRecently, the network market is growing within the larger framework of cloud and virtualization. In addition to traditional equipment-centric network monitoring, the processes that perform tasks are becoming critical monitoring targets. With the WhaTap network performance monitoring, you can reliably monitor network metrics at the process level.\\n\\nWhaTap\'s `Network` products trace the network behaviors performed by each process and visualize complex components and status information through the topology for intuitive understanding. You can view **quality metrics** (***Latency*** and ***Jitter***) and **network usage metrics** (***bps***, ***pps***, and ***session count***). Visibility has been obtained with tag options and various user custom charts have been provided through <Cmdname sid=\\"side_flexboard\\" className=\\"uitext\\" />.\\n\\nThe following overview guide helps you check new features and major changes in the `Network` products in Q1 2024 along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about the `Network` product, see [the following](https://docs.whatap.io/en/npm/introduction). \\n\\n- For more information about the agent options for AWS resource identification, see [the following](https://docs.whatap.io/npm/set-aws-resource-options). \\n\\n:::\\n\\n<br/>\\n\\n{/* ## `AWSLog`\\n\\n<div class=\'indentTab\'>\\n\\nimport AWSLog_1q from \\"../crw-data/crwld-service/_import-service-AWSLog.mdx\\";\\n\\n<AWSLog_1q />\\n\\n</div> <br/> */}\\n\\n## `Log`\\n\\nWhaTap has introduced the reorganized **Log search filtering feature** with notable new features and changes to the `Log` product in Q1 2024. \\n\\nThe **Log search filtering feature** has been reorganized in <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_logTail\\" className=\\"uitext\\" />. When entering a search value, you can check the search grammar supported through the guide UI, and the feature has been added to create and modify a tag through keyboard input and modify operators by clicking.\\n\\nAdditionally, if the agent option has been set, the feature to collect log levels (<span class=\'logwr\'>WARN</span>, <span class=\'loger\'>ERROR</span>, <span class=\'logft\'>FATAL</span>) and display their colors on the left side of the log list has been added.  \\n\\n![Log agent option cl branching example](/img/log-agent-option-level.png)\\n\\nThe following overview guide helps you understand new features and major changes in `Log` products in Q1 2024, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Log_1q from \\"../crw-data/crwld-service/_import-service-Log.mdx\\";\\n\\n<Log_1q />\\n\\n</details>\\n\\n<br/>"},{"id":"index","metadata":{"permalink":"/en/blog/index","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-index.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2024-index.mdx","title":"What\'s new?","description":"{/ changelog \uAD00\uB828 \uC774\uBBF8\uC9C0 /}","date":"2024-04-08T10:00:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"Content composition","permalink":"/en/blog/tags/content-composition"}],"hasTruncateMarker":true,"authors":[{"name":"TW team","email":"docs@whatp.io","title":"Technical writer team","imageURL":"./img/teamtw.svg","key":"twt","page":null}],"frontMatter":{"slug":"index","title":"What\'s new?","authors":["twt"],"date":"2024-04-08T10:00","tags":["New features","Content composition"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"First quarter guidance","permalink":"/en/blog/2024-1q-summary"},"nextItem":{"title":"Fourth quarter guidance","permalink":"/en/blog/2023-4q-summary"}},"content":"{/* changelog \uAD00\uB828 \uC774\uBBF8\uC9C0 */}\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n**What\'s new** provides a quarterly overview of new features and notable changes for each WhaTap product. It provides a summary for services and agents. Take a look at new features offered by WhaTap at a glance. \\n\\nAt the top of the content, you can easily see new features and major changes for that quarter in a table format. The services and agent guide layouts for each product are as follows: \\n\\n{/* truncate */}\\n\\n{/* \uCF58\uD150\uCE20 \uC0C1\uB2E8\uC5D0\uC11C\uB294 \uD14C\uC774\uBE14 \uBC29\uC2DD\uC73C\uB85C \uD574\uB2F9 \uBD84\uAE30 \uC2E0\uADDC \uAE30\uB2A5 \uBC0F \uC8FC\uC694 \uBCC0\uACBD \uC0AC\uD56D\uC744 \uAC04\uB2E8\uD558\uAC8C \uD655\uC778\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. The services and agent guide layouts for each product are as follows:  */}\\n\\n![New feature content example sc cl](/img/changelog/changelog-ex.png)\\n\\nNew features and changes for the product are introduced selectively along with an overview of the released version of the product so that you can see the overall flow of the quarterly service (<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, <code class=\'Changed\'>Changed</code>) and agents (<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, and <code class=\'Deprecated\'>Deprecated</code>). If you click the released version\'s tag (<code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0\u200B</code></a></code>), its release notes for that version appears. \\n\\n{/* :::note \\n\\nIf you click the released version\'s tag <code class=\'changelog-service\'><a href=\\"../release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0</code></a></code> in the overview guide entry, its release notes appears for that version.\\n\\n::: */}"},{"id":"2023-4q-summary","metadata":{"permalink":"/en/blog/2023-4q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-4q-summary.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2023-4q-summary.mdx","title":"Fourth quarter guidance","description":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 4th quarter services in 2023. Take a look at new features offered by WhaTap at a glance.","date":"2023-12-31T15:20:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"2023","permalink":"/en/blog/tags/2023"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2023-4q-summary","title":"Fourth quarter guidance","authors":"ysj","date":"2023-12-31T15:20","toc_max_heading_level":2,"tags":["New features","2023"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"What\'s new?","permalink":"/en/blog/index"},"nextItem":{"title":"Third quarter guidance","permalink":"/en/blog/2023-3q-summary"}},"content":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 4th quarter services in 2023. Take a look at new features offered by WhaTap at a glance.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n| **Common** |\\n| ---------- |\\n\\n> - **WhaTap Mobile App** has been newly released.\\n> - <Cmdname sid=\\"platform_catalog\\" className=\\"uitext\\" /> and several menus have been improved for user convenience.\\n> - <code class=\\"my\\">V2</code> of <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" /> has been provided.\\n\\n{/* > * <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> \uBC0F <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> \uBA54\uB274 \uB4F1\uC758 \uD654\uBA74\uC774 \uAC1C\uC120\uB418\uC5C8\uC2B5\uB2C8\uB2E4. */}\\n\\n| **Application** |\\n| --------------- |\\n\\n> - The <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> feature has been reorganized.\\n> - <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> has been reorganized in a preset format.\\n\\n| **Server** |\\n| ---------- |\\n\\n> The <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> option has been provided.\\n\\n| **Kubernetes** |\\n| -------------- |\\n\\n> - The <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> menu has been reorganized.\\n> - Submenus under <Cmdname sid=\\"side_resource\\" className=\\"uitext\\" /> have been added.\\n\\n{/* > * \uD1B5\uD569 \uCEE8\uD14C\uC774\uB108 \uB9F5\\n\\n> - \uBA54\uB274 \uAC04 \uB3D9\uC120 \uAC1C\uD3B8 */}\\n\\n| **Database** |\\n| ------------ |\\n\\n> The official transition to <code class=\\"my\\">V2</code> of `PostgreSQL` and `MySQL` products has been completed, and their service improvements have been made. \\n\\n| **Browser** |\\n| ----------- |\\n\\n> The <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" /> menu has been provided.\\n\\n{/* \\n|**Network**|\\n|---|\\n\\n> **Beta** service of the **Network Performance Monitoring** product has been released.  */}\\n\\n</div>\\n\\nAn overview of changes other than new features for each product, the corresponding release versions, and changes in the agent can be found in the following guide.\\n\\n<br/>\\n<br/>\\n\\n## `Common`\\n\\nThe launch of the WhaTap **Mobile App**, screen improvements, and maintenance plan <code class=\\"my\\">V2</code> are introduced, as well as notable new features and changes in the `Common` section of the 4th quarter, 2023.\\n\\nIn the fourth quarter, a new WhaTap **Mobile App** has been launched. You can check the major charts of the WhaTap monitoring service <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" /> or receive real-time notifications through the app. You can also use the OTP feature as the secondary authentication tool upon logging in. It is scheduled to expand the support scope for future updates.\\n\\n![Mobile app sc cl](/img/changelog/changelog-mobile-app.png)\\n\\nFor better user experience and convenience, the service UIs have been improved. The **Service Notice** feature has been added to check for regular release news and emergency maintenances of WhaTap Monitoring Service, the product catalog screen has been reorganized, and product introduction information is provided in the sidebar menu. \\n\\nSome menu screens such as <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> have been also improved. For the <Cmdname sid=\\"side_paymentInformation\\" className=\\"uitext\\" /> menu, the currency selection feature is provided when entering the payment information. For the <Cmdname sid=\\"side_agentSetting\\" className=\\"uitext\\" /> menu, the list of options has been simplified to improve readability, and only the applied final options are displayed.\\n\\nA new <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" /> <code class=\\"my\\">V2</code> that is a reorganized version of <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" />, is provided. The new <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" /> allows to add maintenance plans for each agent, and allows to use the repetition option for server projects. However, the previous maintenance plans and new ones are not compatible. \\n\\n![Maintenance Plan sc cl](/img/changelog/changelog-maintenance-plan.png)\\n\\nThe following overview guide helps you understand what\'s new and what\'s not in the Common section for the 4th quarter in 2023, along with the released versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Common_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Common.mdx\\";\\n\\n<Common_23q4 />\\n\\n</details>\\n\\n:::note \\n\\n- For more information about the mobile app, see [the following](../../mobile-app). Download the mobile app by selecting the link or scanning the QR code.\\n\\n  | [iOS](https://apps.apple.com/us/app/whatap-mobile/id6450067434) | [Android](https://play.google.com/store/apps/details?id=io.whatap.lion) |\\n  | :-------------------------------------------------------------: | :---------------------------------------------------------------------: |\\n  |              ![QR](/img/mobile/whatap-app-ios.png)              |                ![QR](/img/mobile/whatap-app-android.png)                |\\n\\n- For more information about the new <Cmdname sid=\\"side_maintenancePlan\\" className=\\"uitext\\" />, see [the following](https://docs.whatap.io/management/maintenance#maintenance-v2). \\n\\n:::\\n\\n<br/>\\n\\n## `Applicatoin`\\n\\nWhaTap introduces notable new features and changes to the `Application` product suite in Q4 2023, including enhancements to <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_dashboard\\" className=\\"uitext\\" />. \\n\\nAs part of the <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> enhancement, the <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> window has been reorganized when <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" /> is dragged. The project filtering feature has been added to the <Cmdname sid=\\"multi_transaction\\" className=\\"uitext\\" /> tab, and an appropriate guidance message appears when the log data is not retrieved in the ***Transaction Log*** tab. For example, you can check the cases where there is no log data, collection is not possible due to no agent configuration, and the log is disabled.\\n\\n<Cmdname sid=\\"application_dashboard\\" className=\\"uitext\\" /> has been reorganized. The time selector option has been added to view not only the real-time data but also **historical data**. And users can add and remove widgets in the dashboard, and even resize them. The **preset** feature has been added to save and load the position, size, and layout of the edited widget.\\n\\n|             Viewing the historical data            |\\n| :------------------------------------------------: |\\n|      ![](/img/release/none-realtime-mode.png)      |\\n|                **Dashboard preset**                |\\n| ![](/img/release/apm-dashboard-preset-feature.png) |\\n\\nAdditionally, efforts have been made to unify and standardize some duplicate application metric names. For example, the metric names used as URLs, transactions, and transaction names have been unified as <Cmdname sid=\\"side_tx\\" className=\\"uitext\\" />. In addition, the metric names used as HTTPC, HTTP call, HTTPC count, and the like have been unified as <Cmdname sid=\\"httpc_count\\" className=\\"uitext\\" />. In addition, the overall terminology standardization has been made. \\n\\nThe following overview guide helps you understand new features and major changes in the `Application` product suite in Q4, 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Applicatoin_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Application.mdx\\";\\n\\n<Applicatoin_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-java.mdx\\";\\n\\n<Java_agent_23q4 />\\n\\n{/* ### `PHP`\\n\\nimport PHP_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-php.mdx\\";\\n\\n<PHP_agent_23q4 />\\n\\n### `Python`\\n\\nimport Python_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-python.mdx\\";\\n\\n<Python_agent_23q4 /> */}\\n\\n### `Node.js`\\n\\nimport Node_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-nodejs.mdx\\";\\n\\n<Node_agent_23q4 />\\n\\n### `.NET`\\n\\nimport DOTNET_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dotnet.mdx\\";\\n\\n<DOTNET_agent_23q4 />\\n\\n{/* ### `Go`\\n\\nimport Go_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-golang.mdx\\";\\n\\n<Go_agent_23q4 /> */}\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\nNotable new features and changes in the `Server` products in Q4 2023 include improvements to the <Cmdname sid=\\"side_serverDetail\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> menus.\\n\\nIn <Cmdname sid=\\"side_serverDetail\\" className=\\"uitext\\" />, the x-axis display unit in the chart has been changed to time to improve readability in the date-based view.\\n\\nIn <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" />, the <Cmdname sid=\\"event_tag\\" className=\\"uitext\\" /> option has been added to set whether to receive notifications for server and process events for specific project members or teams. You can now edit the default notification name. In case of the default notification, a separate `default` tag is displayed separately.\\n\\nThe following overview guide helps you understand new features and major changes in `Server` products in Q4 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Server_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Server.mdx\\";\\n\\n<Server_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Server_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-server.mdx\\";\\n\\n<Server_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\nNotable new features and changes in the `Kubernetes` products have been introduced in Q4 2023, including the improved and added sub menus under <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" />. \\n\\n{/* \uC640\uD0ED \uCFE0\uBC84\uB124\uD2F0\uC2A4 \uBAA8\uB2C8\uD130\uB9C1 \uC0C1\uD488\uC758 \uACBD\uC6B0 \uD1B5\uD569 \uCEE8\uD14C\uC774\uB108 \uB9F5 \uAC1C\uBC1C \uBC0F \uBA54\uB274 \uAC04 \uB3D9\uC120 \uAC1C\uD3B8 */}\\n\\n<Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> of the WhaTap Kubernetes monitoring has been continuously improved. In this 4th quarter, the <Cmdname sid=\\"TTL06891\\" className=\\"uitext\\" /> tab has been newly added to the Display Detail window, which allows you to check the call flow and outbound call status of applications running on containers.\\n\\n<ImgLang img=\'k8s-container-map-call-info-app.png\' desc=\'App call flow diagram branching example\' />\\n\\nAdditionally, both the container and Pod views now allow you to select a list of application-related fields (`app_counter`) for the block color display metric. And the feature to display the blocks of containers and Pods that have disappeared for 1 minute, has been added. \\n\\nIn addition, the list menu under <Cmdname sid=\\"side_resource\\" className=\\"uitext\\" /> has been reorganized and newly added. The <Cmdname sid=\\"side_nodeList\\" className=\\"uitext\\" /> menu has been updated with new node information metric and the filter search feature. Additionally, the time refresh interval has been changed from 1 minute to 10 seconds. The <Cmdname sid=\\"side_clusterOverview\\" className=\\"uitext\\" /> menu has been newly added, allowing you to check the version and various objects on the cluster at a glance. \\n\\nThe <Cmdname sid=\\"pendingPod\\" className=\\"uitext\\" /> menu has been newly added in <Cmdname sid=\\"side_lab\\" className=\\"uitext\\" /> of the namespace project. The <Cmdname sid=\\"pendingPod\\" className=\\"uitext\\" /> menu is an experimental feature to quickly identify Pods in the Pending status. \\n\\nThe following overview guide helps you understand new features and major changes in the `Kubernetes` products in Q4 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Kubernetes_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.8</code> <code class=\'changelog-date\'>October 4, 2023</code>\\n\\n- <Status>Feature</Status> Additionally collects data for new development of Pod list (podIp, age, restartCount).\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.1</code> <code class=\'changelog-date\'>November 8, 2023</code>\\n\\n- <Status>Feature</Status> Added cluster information of the Kubernetes.\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.2</code> <code class=\'changelog-date\'>November 16, 2023</code>\\n\\n- <Status>Feature</Status> Added the data to be collected in the <code>kube_pod</code> category.\\n\\n  - <code>qosClass</code>: Quality of service for Pods\\n  - <code>startTime</code>: Pod start time\\n  - <code>podHash</code>: Hash value of the Pod name\\n  - <code>con_cpu_limit_total</code>: Total CPU limit of containers inside the Pod\\n  - <code>con_mem_alloc_fail_total_count</code>: Sum of memory allocation failures for containers inside the Pod\\n\\n</details>\\n\\n<br/>\\n\\n## `Database`\\n\\nHere are notable new features and changes to the `Database` product suite in Q4 2023. \\n\\nIn this fourth quarter, the <code class=\\"my\\">V2</code> services were converted to official services for the **PostgreSQL** and **MySQL** products in the `Database` product suite. And the name of the **MS SQL Server** product has been changed to **SQL Server**.\\n{/* \uBA3C\uC800 **PostgreSQL**\uC5D0 \uB4A4\uC774\uC5B4 \uC774\uBC88 4\uBD84\uAE30\uC5D0 `Database` \uC0C1\uD488\uAD70 \uC911 **MySQL** \uC0C1\uD488 <code class=\\"my\\">V2</code> \uC11C\uBE44\uC2A4\uAC00 \uC815\uC2DD \uC11C\uBE44\uC2A4\uB85C \uC804\uD658\uB418\uC5C8\uC2B5\uB2C8\uB2E4. And the name of the **MS SQL Server** product has been changed to **SQL Server**.  */}\\n\\nThe UI of the <Cmdname sid=\\"TTL06224\\" className=\\"uitext\\" /> menu has been improved for better user convenience in the `Database` product suite. Placement of the query view and plan view areas can now be modified by the user, and parameter binding has been changed to be performed by default. You can also collapse the active session table in <Cmdname sid=\\"side_dbMonitoring\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_multiInstance\\" className=\\"uitext\\" /> for a wider graph chart.\\n\\nThe following overview guide helps you understand new features and major changes in the `Database` product suite in Q4 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Database_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Database.mdx\\";\\n\\n<Database_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dbx.mdx\\";\\n\\n<DBX_agent_23q4 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-xos.mdx\\";\\n\\n<XOS_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `URL`\\n\\nFor the `URL` product in Q4 2023, a new UI has been added to select the interval for collecting the monitoring data. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport URL_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-URL.mdx\\";\\n\\n<URL_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n<Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" /> has been introduced a notable new feature of the WhaTap `Browser` product in Q4 2023.\\n\\nThe Asynchronous JavaScript and XML (**AJAX**) technology exchanges data and updates web pages in an asynchronous manner. AJAX that has advantages of improving user experience and reducing requests to the server, requires monitoring because it is implemented in JavaScript code. \\n\\nYou can check the response times of AJAX events over time in the hitmap chart through the <Cmdname sid=\\"side_ajaxAnalytics\\" className=\\"uitext\\" /> menu provided by the WhaTap `Browser` monitoring, and you can view detailed information such as detailed times for each event section, AJAX request URL and calling page information, error messages, and status codes. \\n\\n![AJAX Hitamp sc cl](/img/changelog/changelog-browser-ajax.png)\\n\\nThe following overview guide helps you understand new features and major changes in `Browser` products in Q4 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Browser_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Browser.mdx\\";\\n\\n<Browser_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Browser_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-browser.mdx\\";\\n\\n<Browser_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Cloud`\\n\\nFor the `Cloud` product in Q4 2023, the <Cmdname sid=\\"side_userBehavior\\" className=\\"uitext\\" /> menu has been newly added to detect user interactions in the project and provide insights to user behaviors. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Cloud_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Cloud.mdx\\";\\n\\n<Cloud_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\nHere are notable new features and changes to the `Log` products in Q4 2023.\\n\\nThe **Guide UI** has been added in the <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> menu to guide to the log search filtering syntax. You can check the supported search grammar when entering search values \u200B\u200Bthrough the guide UI.\\n\\n<ImgLang img=\'log-filter-ui1.png\' desc=\'Log filter cl branching example\'/>\\n\\nIn addition, the switching feature to full screen has been added to allow you to check only the timestamps and logs, and validation for reserved words has been added after entering the search value \u200B\u200Bfor log detection conditions when adding a parser in the Log 1st Parser Settings tab. \\n\\nThe following overview guide helps you understand new features and major changes in `Log` products in Q4 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Log_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Log.mdx\\";\\n\\n<Log_23q4 />\\n\\n</details>\\n\\n<br/>"},{"id":"2023-3q-summary","metadata":{"permalink":"/en/blog/2023-3q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-3q-summary.mdx","source":"@site/i18n/en/docusaurus-plugin-content-blog/2023-3q-summary.mdx","title":"Third quarter guidance","description":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 3rd quarter services in 2023. Take a look at new features offered by WhaTap at a glance.","date":"2023-10-31T15:10:00.000Z","tags":[{"inline":true,"label":"New features","permalink":"/en/blog/tags/new-features"},{"inline":true,"label":"2023","permalink":"/en/blog/tags/2023"}],"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"Technical writer","imageURL":"./img/teamtwj.svg","key":"ysj","page":null}],"frontMatter":{"slug":"2023-3q-summary","title":"Third quarter guidance","authors":"ysj","date":"2023-10-31T15:10","toc_max_heading_level":2,"tags":["New features","2023"],"isTranslationMissing":false},"unlisted":false,"prevItem":{"title":"Fourth quarter guidance","permalink":"/en/blog/2023-4q-summary"}},"content":"Here\u2019s an overview of new features and notable changes of WhaTap\u2019s 3rd quarter services in 2023. Take a look at new features offered by WhaTap at a glance.\\n\\n<ImgLang img=\'changelog/changelog-new3.png\' desc=\'New features\' />\\n\\n{/* truncate */}\\n\\n{/* db \uC0C1\uD488 \uC911 mysql v2 \uC11C\uBE44\uC2A4 \uC81C\uACF5 \uC2DC\uC810 \uD655\uC778 \uD544\uC694 */}\\n\\n<div class =\'faq\'>\\n\\n| **Common** |\\n| ---------- |\\n\\n> Added **Project flexboard update** role.\\n\\n| **Application** |\\n| --------------- |\\n\\n> - The <Cmdname sid=\\"TTL06209\\" className=\\"uitext\\" /> feature has been newly reorganized.\\n> - The <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> menu map chart has been improved.\\n\\n| **Server** |\\n| ---------- |\\n\\n> The <Cmdname sid=\\"sms_resource_board\\" className=\\"uitext\\" /> and <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" /> menus have been improved.\\n\\n| **Kubernetes** |\\n| -------------- |\\n\\n> - Installation of ***Docker PHP*** has been provided.\\n> - The <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> menu has been provided.\\n>   {/* > * <Cmdname sid=\\"side_containerMap\\" className=\\"uitext\\" /> \uBC0F <Cmdname sid=\\"side_perfSummary\\" className=\\"uitext\\" /> \uBA54\uB274\uAC00 \uAC1C\uC120\uB418\uC5C8\uC2B5\uB2C8\uB2E4. */}\\n\\n| **Database** |\\n| ------------ |\\n\\n> - The **PostgreSQL** product\'s <code class=\\"my\\">V2</code> service has been launched.\\n> - The **MySQL** product\'s <code class=\\"my\\">V2</code> service has been launched.\\n\\n| **Browser** |\\n| ----------- |\\n\\n> - The ***Pageload hitmap*** menu has been improved. \\n> - Error details have been added to the <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" /> menu.\\n\\n| **AWS Log** |\\n| ----------- |\\n\\n> The `AWS Log` monitoring product\'s **official** service has been launched. \\n\\n| **Network** |\\n| ----------- |\\n\\n> **Beta** service of the **Network Performance Monitoring** product has been launched. \\n\\n</div>\\n\\nAn overview of changes other than new features for each product, the corresponding release versions, and changes in the agent can be found in the following guide.\\n\\n<br/>\\n<br/>\\n\\n## `Common`\\n\\nNotable new features and changes in the `Common` section of WhaTap Q3 2023 include the addition of **Edit Project Flexboard** role and improvements for convenience.\\n\\nThe **Edit Project Flexboard** role has been added, so you need this role to edit the ***Flex Board*** in the project. \\n\\nOther updates have been made to improve overall convenience. The <Cmdname sid=\\"BTN06853\\" className=\\"uitext\\" /> menu has been added to check WhaTap\'s service version and product list. \\n\\n<LinkImage img=\'changelog/changelog-whatap-info.png\' desc=\'\' className=\'noneborder\' />\\n\\nIn addition, the **WhatsApp** notification configuration has been added in <Cmdname sid=\\"side_eventNoti\\" className=\\"uitext\\" /> and the time selection restriction method when generating daily reports in <Cmdname sid=\\"side_integratedReport\\" className=\\"uitext\\" /> has been changed. Previously, you could select an end time up to 23:59 of the previous day, but now you can select an end time up to 1 hour before the current time. \\n\\nThe following overview guide helps you understand what\'s new and what\'s not in the Common section for the 3rd quarter in 2023, along with the released versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Common_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Common.mdx\\";\\n\\n<Common_23q3 />\\n\\n</details>\\n<br/>\\n\\n## `Applicatoin`\\n\\nWe are introducing notable new features and changes in the `Application` product suite in Q3 2023, including the reorganized ***Transaction analysis*** feature and improvements to the <Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> screen. \\n\\nThe ***Transaction analysis*** feature has been reorganized. Previously, the transaction list was loaded under <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" />, but now, the ***Transaction analysis*** pop-up window appears when you drag <Cmdname sid=\\"hitmap\\" className=\\"uitext\\" />, making it easier to analyze and compare information details for each section. Additionally, an option has been added to directly view errors only in the transaction list filter.\\n\\n<LinkImage img=\'release/release-note-tx-new-feature.png\' desc=\'\' className=\'noneborder\' />\\n\\n<Cmdname sid=\\"side_transaction_map\\" className=\\"uitext\\" /> has changed the map design to improve visibility, and the error cases are now displayed first when normal and error transactions overlap.\\n\\n|                  Before modification                 |                 After modification                 |\\n| :--------------------------------------------------: | :------------------------------------------------: |\\n| ![before](/img/release/before-transaction-chart.png) | ![after](/img/release/after-transaction-chart.png) |\\n\\nAdditionally, for `.NET` products, the <Cmdname sid=\\"side_stack\\" className=\\"uitext\\" /> menu that was available only for `Java` and `Python` products, has been added. You can easily check <Cmdname sid=\\"topstack\\" className=\\"uitext\\" />, <Cmdname sid=\\"uniquestack\\" className=\\"uitext\\" />, and <Cmdname sid=\\"active_stack\\" className=\\"uitext\\" /> through the <Cmdname sid=\\"side_stack\\" className=\\"uitext\\" /> menu.\\n\\nThe following overview guide helps you understand new features and major changes in the `Application` product suite in Q3, 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Application_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application.mdx\\";\\n\\n<Application_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-java.mdx\\";\\n\\n<Java_agent_23q3 />\\n\\n### `PHP`\\n\\n#### <code class=\'changelog-service\'>PHP Agent v2.6.2</code> <code class=\'changelog-date\'>September 13, 2023</code>\\n\\n- <Status>Feature</Status> Added the large profile processing option.\\n\\n  - **whatap.large_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    Default `false`\\n\\n    We can collect up to 10,000 profiles (steps). For a larger collection, it is recommended to use the `split_profile_enabled` option.\\n\\n  - **whatap.split_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    Default `false`\\n\\n    It collects more profiles by separating certain amounts of profiles into virtual transactions. Multiple transaction lists are separated for display.\\n\\n- <Status>Feature</Status> Added the compressed profile data transmission option.\\n\\n  - **whatap.profile_zip_enabled** <span class=\'type\'>Boolean</span>  Defalut `true`\\n\\n### `.NET`\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.1</code> <code class=\'changelog-date\'>July 17, 2023</code>\\n\\n- <Status>New</Status> The active stack is supported.\\n\\n- <Status>New</Status> The .Net support environment analysis tool has been added.\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.2</code> <code class=\'changelog-date\'>July 20, 2023</code>\\n\\n- <Status>New</Status> WCF is supported.\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.5</code> <code class=\'changelog-date\'>September 13, 2023</code>\\n\\n- <Status>New</Status> Added the <code>webservice_method_timeout</code> option to adjust the timeout.\\n\\n### `Go`\\n\\nimport Go_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-golang.mdx\\";\\n\\n<Go_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `Application`, `Container`, `Server`\\n\\nimport ApplicationContainerServer_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application-Container-Server.mdx\\";\\n\\n<ApplicationContainerServer_23q3 /> */}\\n\\n## `Server`\\n\\nFor the `Server` product in Q3 2023, the feature to copy the existing event configuration to the current project has been added in <Cmdname sid=\\"side_eventSetting\\" className=\\"uitext\\" />, and improvements have been made for user convenience, such as displaying the fatal and warning status separately in the agent status widget in <Cmdname sid=\\"sms_resource_board\\" className=\\"uitext\\" />. \\n\\nThe following overview guide helps you understand new features and major changes in `Server` products in Q3 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Server_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Server.mdx\\";\\n\\n<Server_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\nNotable new features and changes in WhaTap\'s Q3 2023 `Kubernetes` products include **Docker PHP** installation and the newly added <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> menu.\\n\\n{/* ***\uCEE8\uD14C\uC774\uB108 \uB9F5*** \uBC0F <Cmdname sid=\\"side_perfSummary\\" className=\\"uitext\\" /> \uBA54\uB274\uC758 \uAC1C\uC120\uC5D0 \uB300\uD574 \uC18C\uAC1C\uD569\uB2C8\uB2E4. */}\\n\\nIt applies the WhaTap monitoring agent to the **PHP application** running on the Docker container and packages the container image. After installing the whatap-php package, you can install the agent by setting the installation scripts and container environment variables. \\n\\nThe <Cmdname sid=\\"side_integratedContainerMap\\" className=\\"uitext\\" /> menu has been newly provided, including the cluster project and namespace project. The unified container map provides additional grouping options for each project, allowing you to view container maps in cluster projects and individual namespace projects.\\n\\n<LinkImage img=\'k8s-container-map-unified-whatapproject.png\' desc=\'\' className=\'noneborder\' />\\n\\nThe following overview guide helps you understand new features and major changes in the `Kubernetes` products in Q3 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Container_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Container.mdx\\";\\n\\n<Container_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.6</code> <code class=\'changelog-date\'>September 27, 2023</code>\\n\\n- <Status>Feature</Status> Added the node data (cluster version, node status, etc.) for update of the node list.\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.7</code> <code class=\'changelog-date\'>September 27, 2023</code>\\n\\n- <Status>Feature</Status> Added the key value for linking the node list in the application list menu to be reorganized.\\n\\n</details>\\n\\n<br/>\\n\\n## `Database`\\n\\nWhaTap introduces notable new features and changes to the `Database` product suite in Q3 2023, <code class=\\"my\\">V2</code> service launching.\\n\\nIn this third quarter, the <code class=\\"my\\">V2</code> services of the `PostgreSQL` and `MySQL` products have been launched. The <code class=\\"my\\">V2</code> services have focused on improving convenience. \\n\\nRDS and XOS tabs have been separated by product environment and the <Cmdname sid=\\"side_dbMonitoring\\" className=\\"uitext\\" /> menu has been improved. For example, the option to save active session table presets and the option to view plans in session details have been added. \\n\\nThe following overview guide helps you understand new features and major changes in the `Database` product suite in Q3 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Database_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Database.mdx\\";\\n\\n<Database_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-dbx.mdx\\";\\n\\n<DBX_agent_23q3 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-xos.mdx\\";\\n\\n<XOS_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\nNotable new features and changes to the `Browser` product in Q3 2023 include ***Pageload hitmap*** menu improvements and <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" /> error details.\\n\\nIn case of ***Pageload Hitmap***, the OS version and client IPs have been added to the detailed pageload data, and the filtering feature has been newly provided.\\n\\nNow, when you select an error message from the ***Error message table*** list in <Cmdname sid=\\"side_rumErrorDashboard\\" className=\\"uitext\\" />, you can view detailed statistical information about the error based on the error message. You can also view error logs that occurred for each time zone.\\n\\n<LinkImage img=\'browser-error-details-log.png\' desc=\'Error log branching example\' />\\n\\nThe following overview guide helps you understand new features and major changes in `Browser` products in Q3 2023, along with release versions. \\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Browser_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Browser.mdx\\";\\n\\n<Browser_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>Agent guide</b></summary>\\n\\nimport Browser_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-browser.mdx\\";\\n\\n<Browser_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\nIn the third quarter of 2024, WhaTap officially launched its Beta service of the **Network Performance Monitoring** product, which collects network data for processes to identify congestion and failures between networks and improve users\' network performance. For more information about the product, see [the following](https://docs.whatap.io/en/npm/introduction). \\n\\n<br/>\\n\\n{/* <details className=\'changelog\'>\\n\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</div>  */}\\n\\n{/* ## `CloudWatch`, `AZURE`, `OCI`, `NCP`\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Cloud_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-CloudWatch-AZURE-OCI-NCP.mdx\\";\\n\\n<Cloud_23q3 />\\n\\n</div><br/> */}\\n\\n## `AWS Log`\\n\\nWhaTap\'s `AWS Log` monitoring service has been officially launched in the third quarter of 2023. Without having to go through the cumbersome process of checking each resource in S3 and Log Group, WhaTap `AWS Log` collects various logs generated on AWS and provides the integrated monitoring. For more information about the product, see <a href=\\"../../aws-log/introduction\\">the following</a>.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport AWSLog_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-AWSLog.mdx\\";\\n\\n<AWSLog_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\nHere are notable new features and changes to the `Log` products in Q3 2023. \\n\\nUpdates have been made to improve overall convenience. The keyword highlighting feature has been added to the <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" />, <Cmdname sid=\\"side_logExplorer\\" className=\\"uitext\\" />, and <Cmdname sid=\\"transaction_log\\" className=\\"uitext\\" /> menus. Additionally, the adjacent log search feature has been added to the <Cmdname sid=\\"side_logSearch\\" className=\\"uitext\\" /> menu. \\n\\nThe following overview guide helps you understand new features and major changes in `Log` products in Q3 2023, along with release versions.\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Log_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Log.mdx\\";\\n\\n<Log_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `\uC2E4\uD5D8\uC2E4`\\n\\n<details className=\'changelog\'>\\n<summary><b>Guide to new features and major changes</b></summary>\\n\\nimport Lab_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Lab.mdx\\";\\n\\n<Lab_23q3 />\\n\\n</div><br/> */}"}]}}')}}]);